INSERT INTO `cms_statics` (`id`, `orgid`, `title`, `titleid`, `image`, `content`, `status`, `created`, `seton`) VALUES
(1, 1, 'About Us', 0, '', '<p>About Us content here</p><p>Mycourier</p>', 'Y', '2015-12-15', 'Y'),
(2, 1, 'FAQ', 0, '', '<ul>\r\n<li>\r\n<strong>Does the student travel on Metro and pay a fare?</strong>\r\n<p>You can apply directly to Metro online or in store. For more information about Metro travel\r\nYou can apply directly to Metro online or in store. For more information about Metro travel</p>\r\n</li>\r\n\r\n<li>\r\n<strong>Does the student travel on Metro and pay a fare?</strong>\r\n<p>You can apply directly to Metro online or in store. For more information about Metro travel\r\nYou can apply directly to Metro online or in store. For more information about Metro travel</p>\r\n</li>\r\n\r\n\r\n<li>\r\n<strong>Does the student travel on Metro and pay a fare?</strong>\r\n<p>You can apply directly to Metro online or in store. For more information about Metro travel\r\nYou can apply directly to Metro online or in store. For more information about Metro travel</p>\r\n</li>\r\n\r\n<li>\r\n<strong>Does the student travel on Metro and pay a fare?</strong>\r\n<p>You can apply directly to Metro online or in store. For more information about Metro travel\r\nYou can apply directly to Metro online or in store. For more information about Metro travel</p>\r\n</li>\r\n\r\n<li>\r\n<strong>Does the student travel on Metro and pay a fare?</strong>\r\n<p>You can apply directly to Metro online or in store. For more information about Metro travel\r\nYou can apply directly to Metro online or in store. For more information about Metro travel</p>\r\n</li>\r\n\r\n\r\n\r\n<li>\r\n<strong>Does the student travel on Metro and pay a fare?</strong>\r\n<p>You can apply directly to Metro online or in store. For more information about Metro travel\r\nYou can apply directly to Metro online or in store. For more information about Metro travel</p>\r\n</li>\r\n\r\n\r\n\r\n</ul>', 'Y', '2015-12-15', 'Y'),
(3, 1, 'Terms and Conditions', 0, '', '\r\n<i class="fa fa-plane"></i> Customers are required to provide complete information regarding the type \r\n\r\nand specifications of the goods to be delivered at MCB portal/app and to \r\n\r\nTransporter. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i> MCB does not provide specific box for shipping. Customers are responsible \r\n\r\nfor properly packing the goods to be delivered. For fragile items made of \r\n\r\nglass, ceramic and includes cakes, food, fresh flowers etc. it is suggested \r\n\r\nthat the item is specially packaged. MCB is not responsible for damage or \r\n\r\ndeformation that occurs upon delivery of such goods.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> The MCB transporters has been guided to take the packages in a safe \r\n\r\nmanner. However, customers who use MCB transportation services are \r\n\r\nresponsible for their package safety. Therefore if you feel uncomfortable with \r\n\r\nthe way the transporter handles the delivery package, please feedback \r\n\r\naccordingly for Transporter. This will help us to make the selection of \r\n\r\nresponsible transporter and make the services better.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> MCB does not provide delivery service for items which include goods which \r\n\r\nare prohibited by the customs authorities to be owned or distributed within \r\n\r\ncountry and across the borders like Drugs, Illegal items, Weapons, \r\n\r\nChemicals, meat, plants etc. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i> Items dimensions more than 70cm (length), 50cm (width), 50cm (height) or \r\n\r\nitems weighing more than 20 kg are discouraged as such dimensions are \r\n\r\ndifficult to carry and check-in.<br/><br/> \r\n\r\n<i class="fa fa-plane"></i> Goods which are liable for customs duty at departing and destination country \r\n\r\nshall be declared to customs at airport. Its sender''s and courier buddy''s \r\n\r\nmutual responsibility to check if the goods handed over for delivery are liable \r\n\r\nfor customs duty. MCB is not directly responsible for any dispute involving \r\n\r\ncustoms or customs duty payment.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> MCB is not directly responsible for missing package involving MCB \r\n\r\ntransporters or either damage to the package or any distortion of package \r\n\r\ncaused while transporting by transporter. All expenses and charges that may \r\n\r\narise on the incident would be directed to the personal responsibility \r\n\r\nof transporter. If there is information that can be helpful to the investigation \r\n\r\nas contact details and identity details, MCB can only help as a mediator in \r\n\r\nbringing both parties to find a solution regarding the issue.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> MCB presently does not provide insurance for lost or missing items. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i> Voucher codes are strictly valid for one voucher per account within every \r\n\r\npromotion.\r\n\r\n\r\n\r\n\r\n', 'Y', '2015-12-15', 'Y'),
(4, 1, 'Senders Good Practice and Recommendation', 0, '', '\r\n<i class="fa fa-plane"></i> Make sure you pack the goods in such a way that courier buddy can easily\r\n\r\ninspect and aware about the content in package before he accepts the \r\n\r\npackage. This keep the mutual interest of both sender and courier buddy \r\n\r\nintact.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> Packing is very important for shipping your package safely without damage. \r\n\r\nAvoid sending the goods which are fragile and easily damageable without the \r\n\r\nconsent and acceptance of your courier buddy.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> You shall be informed, once your delivery order is accepted and matched \r\n\r\nwith your courier buddy. Coordinate with your courier buddy to handover the \r\n\r\npackage to courier buddy. Prefer to handover the package near to the \r\n\r\ndeparture date and time of the courier buddy. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i> Send the photo of package and your courier buddy to receiver and inform the \r\n\r\nreceiver about the packing details.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> Make sure the goods you are sending are not prohibited by law or other \r\n\r\nregulations to be owned or distributed within country and across the borders \r\n\r\nlike Drugs, Illegal items, Weapons, Chemicals etc.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> Different country have different customs guidelines and guidelines for \r\n\r\nprohibited goods. Make sure you read the customs guidelines for the \r\n\r\ndestination country carefully and follow the guidelines.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> Goods which are liable for customs in destination country shall be clearly \r\n\r\nmentioned and bring in knowledge of your courier buddy. Make sure you \r\n\r\nhave agreement with your courier buddy to pay the customs duty and get the \r\n\r\ngoods clear. MCB is not directly responsible for any dispute involving \r\n\r\ncustoms or customs duty payment.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i> Avoid sending fragile, difficult to handle, expensive and valuable items with \r\n\r\nMCB.', 'Y', '2015-12-15', 'Y'),
(5, 1, 'Transporters Good Practice and Recommendation', 0, '', '\r\n\r\n<i class="fa fa-plane"></i>  Once you confirm your travel plan, book the tickets and receive the PNR \r\n\r\nNumber and Ticket Number from Airlines, then create your trips in My-Trips \r\n\r\nin MCB portal or App. Plan your luggage for your personal use for trip and \r\n\r\nestimate how much you can carry additional as MCB transporter. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  Familiarize yourself with local customs regulations common at destination. \r\n\r\nMake sure package always comply as per the local customs regulations to \r\n\r\nbe carried to transit and destination country. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  Once your trip is saved in MCB, search for suitable deliveries for your \r\n\r\ndestination, and confirm deliveries which are suitable for \r\n\r\ntransportation as per your capacity and convenience.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  Keep in touch with sender by mail, SMS or phone call, discuss exact details \r\n\r\nlike weight and dimensions about the package. Make an appointment with \r\n\r\nsender and finalize about venue, date & time to receive the package. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  Coordinate with sender to receive the package as per both of your \r\n\r\nconvenience. While receiving the delivery, make sure you take photo of \r\n\r\npackage along with the sender for future reference. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  MCB Transporter shall make sure the content of the package is as per the \r\n\r\ndiscussion and specifications about the package category, weight and \r\n\r\ndimension roughly matches with the online order. Upon picking update the \r\n\r\nstatus as "Picked" in MCB app.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  Keep the package safely in hand bag or check-in baggage as per size or \r\n\r\nconvenience to carry. Prefer always to scan the package at airport before \r\n\r\nyou check in or carry in hand bag. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  Remember to coordinate with receiver buddy before you fly so that it''s easy \r\n\r\nto identify and hand order the packet at destination. If possible ask for \r\n\r\ncontact details and other identifications of the receiver. <br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  On meeting receiver hand over the package safely and remember to update \r\n\r\nthe delivered status on MCB app either with your mobile or with receivers \r\n\r\nmobile. At the same time remember to take a photo of delivered package \r\n\r\nwith your receiver buddy for records in your mobile.<br/><br/>\r\n\r\n<i class="fa fa-plane"></i>  Request your sender and receiver buddy to update the feedback for this \r\n\r\ndelivery.\r\n', 'Y', '2015-12-15', 'Y'),
(7, 1, 'Guidelines Section', 0, '', '<h5>Restricted & Banned Items</h5>\r\n<ul class="guid-lst">\r\n  <li>Liquid, semi-liquid and gases</li>\r\n  <li>Currency</li>\r\n  <li>Indian Postal Articles and all items that infringe the Indian Postal Act of 1898</li>\r\n  <li>Precious and semi-precious stones, gems, jewellery and equivalent items</li>\r\n  <li>Perishables</li>\r\n  <li>Radioactive or magnetic material</li>\r\n  <li>Negotiable Instruments (Bearer Form)</li>\r\n  <li>Pornographic material</li>\r\n  <li>Sodexho pass</li>\r\n  <li>Firearms, explosives and military equipment</li>\r\n  <li>Flammable Items</li>\r\n  <li>Toxic and infectious Items</li>\r\n  <li>Corrosives</li>\r\n  <li>Powders and chemicals</li>\r\n  <li>Drugs</li>\r\n  <li>Machinery parts containing oil, grease, fuel or batteries</li>\r\n  <li>All restricted items as per guidelines of IATA</li>\r\n</ul>\r\n<br><br>\r\n<h5>Dangerous Goods</h5>\r\n<span><strong>Definition:</strong> Commodities, which possess potentially hazardous characteristics. These are as the laid out by IATA in the Dangerous Goods Regulations.</span> <br />\r\n<br />\r\n<strong>The categories of dangerous goods are:</strong>\r\n<ul>\r\n  <li><strong><b>Class 1:</b> Explosives</strong></li>\r\n  <li><strong><b>Class 2:</b> Gases</strong></li>\r\n  <li><strong><b>Class 3:</b> Flammable Liquids</strong></li>\r\n  <li><strong><b>Class 4:</b> Flammable Solids</strong></li>\r\n  <li><strong><b>Class 5:</b> Oxidizers and Organic Peroxides</strong></li>\r\n  <li><strong><b>Class 6:</b> Toxic & Infectious Substances</strong></li>\r\n  <li><strong><b>Class 7:</b> Radioactive Material</strong></li>\r\n  <li><strong><b>Class 8:</b> Corrosives</strong></li>\r\n  <li><strong><b>Class 9:</b> Miscellaneous e.g. Magnets - a danger to airplane equipment</strong></li>\r\n</ul>\r\n', 'Y', '2016-02-19', 'Y');
